import React from 'react'
import './modal.css'

function Modal({HandleClose, children}) {
    // console.log('click');
  return (
    <div className='modal-backdrop'>
        <div className='modal'>
            {children}
            <button onClick={HandleClose}>Close</button>
        </div>
    
    </div>
  )
}

export default Modal
